export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},"39jrt30yFn":{data:{id:2636,attributes:{imdbId:"tt1661940",poster:"N\u002FA",type:c,ratings:[{Source:"Internet Movie Database",Value:"8.3\u002F10"}],item_lang:{data:{id:3299,attributes:{title:"Tomorrow",plot:"Terry is going to be great. He has a lot going for him, his children, friends and opportunity. One thing holds him back. Terry is an addict. One bite and he is powerless. Insanity has been described as doing the same thing over and over and expecting different results. 'Just one', turns Terry's day insane. Terry will be great...tomorrow",slug:"tomorrow"}}},books:{data:[{id:12616,attributes:{title:"Tomorrow, When The War Began",description:"When Ellie and six of her friends return home from a camping trip deep in the bush, they find things hideously wrong -- their families gone, houses empty and abandoned, pets and stock dead. Gradually they begin to comprehend that their country has been invaded and everyone in the town has been taken prisoner. As the horrible reality of the situation becomes evident they have to make a life-and-death decision: to run back into the bush and hide, to give themselves up to be with their families, or to stay and try to fight. This reveting, tautly-drawn novel seems at times to be only a step away from today's headlines.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=h6RSRK71PTMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"1995-03-27",publisher:"HarperCollins",subtitle:b}},{id:12617,attributes:{title:"The Night is for Hunting",description:"While trying to care for a group of abandoned young children, five Australian teenagers continue their struggle for survival and their resistance against the enemy invading their homeland.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FAHluJntP-MC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2001-01-01",publisher:"Houghton Mifflin Harcourt",subtitle:b}},{id:12618,attributes:{title:"Take My Word for It",description:"\"Australia's king of young adult fiction\" The Australian Lisa Morris could be the girl next door. She could be your cousin. She could be sitting behind you in class. She could be you. But Lisa, cool and beautiful Lisa, remote and private Lisa, has more going on in her life than anyone imagines. Only her journal knows the truth about her life. Only her journal - and you. Fans of Veronica Roth, Suzanne Collins and John Flanagan will love John Marsden.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9RaAPwCXoEIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"1993-05-05",publisher:e,subtitle:b}},{id:12619,attributes:{title:"Checkers",description:"\"Australia's king of young adult fiction\" The Australian She has parents, a brother, friends and a dog. Sometimes the dog seems like the only one she can trust. Her life is about to fall apart. The dog is Checkers. The book is unforgettable. Fans of Veronica Roth, Suzanne Collins and John Flanagan will love John Marsden.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4cyd4M9Cy6kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"1997-01-01",publisher:e,subtitle:b}},{id:12620,attributes:{title:"Marsden on Marsden",description:"\"I found Ellie's voice quite unexpectedly, as I drove back from the tip one Saturday afternoon. I was in an old Landrover, just 500 metres from home, and suddenly I could hear Ellie talking... \" In his fiction John Marsden explores the lives of the guilty, the inarticulate, the crazy, the brave and the resourceful. Read about his ideas and his experiences in Marsden on Marsden - a frank, behind-the-scenes look at what John was really thinking about when he wrote books like \"Letters from the Inside\" and the internationally acclaimed Tomorrow Series.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=o-nkgW3_gl0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2000-06-01",publisher:e,subtitle:b}}]}}},meta:{}}},prerenderedAt:1681377175973}}("John Marsden","","movie",null,"Pan Australia","series",1))